import React from "react";
import styles from "./home.css"; // Import CSS for styling


const Home = () => {
  return (
<div className={styles.banner}>
      <img src={bannerImage} alt="Loan Offers Banner" className={styles.bannerImage} />
      <div className={styles.bannerText}>
        <h1>MoneyNest</h1>
        <p>Personal Loan: <strong>10% p.a</strong></p>
        <p>Student Loan: <strong>7% p.a</strong></p>
        <p>Gold Loan: <strong>8% p.a</strong></p>
        <p>Home Loan: <strong>8% p.a</strong></p>
        <p>Car Loan: <strong>9% p.a</strong></p>
      </div>
    </div>
  );
};

export default Home;
